import React, { useState } from "react";
import { Link } from 'react-router-dom';

function Formcuenta() {
  const [email, setEmail] = useState("");
  const [nombre, setNombre] = useState("");
  const [telefono, setTelefono] = useState("");
  const [password, setPassword] = useState("");
  const [botonesHabilitados, setBotonesHabilitados] = useState([true, false, false, false]);

  const handleSubmit = (e) => {
    e.preventDefault();
    // Aquí puedes agregar la lógica para crear la cuenta, como validar los datos y llamar a una API
    console.log("Email:", email);
    console.log("Nombre:", nombre);
    console.log("Telefono:", telefono);
    console.log("Password:", password);
  };

  const validarDatos = () => {
    let botonesHabilitadosActualizados = [...botonesHabilitados];
    if (email !== "") {
      botonesHabilitadosActualizados[1] = true;
    } else {
      botonesHabilitadosActualizados[1] = false;
    }
    if (nombre !== "") {
      botonesHabilitadosActualizados[2] = true;
    } else {
      botonesHabilitadosActualizados[2] = false;
    }
    if (telefono !== "") {
      botonesHabilitadosActualizados[3] = true;
    } else {
      botonesHabilitadosActualizados[3] = false;
    }
    setBotonesHabilitados(botonesHabilitadosActualizados);
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name === "email") {
      setEmail(value);
    } else if (name === "nombre") {
      setNombre(value);
    } else if (name === "telefono") {
      setTelefono(value);
    } else if (name === "password") {
      setPassword(value);
    }
    validarDatos();
  };

  return (
    <div className="container">
      <div className="row justify-content-center">
        <div className="col-md-6">
          <div className="h4 mb-3">Completa los datos para crear tu cuenta</div>
          <form onSubmit={handleSubmit}>
            <div className="form-group">
              <label htmlFor="email">Agrega tu e-mail</label>
              <div className="input-group">
                <input type="email" className="form-control" id="email" name="email" value={email} onChange={handleChange} />
                <div className="input-group-append">
                  <Link to="" className={botonesHabilitados[1] ? "btn btn-warning" : "btn btn-secondary"}>Agregar</Link>
                </div>
              </div>
            </div>
            <div className="form-group">
              <label htmlFor="nombre">Elige tu nombre</label>
              <div className="input-group">
                <input type="text" className="form-control" id="nombre" name="nombre" value={nombre} onChange={handleChange} />
                <div className="input-group-append">
                  <Link to="" className={botonesHabilitados[2] ? "btn btn-warning" : "btn btn-secondary"}>Agregar</Link>
                </div>
              </div>
            </div>
            <div className="form-group">
              <label htmlFor="telefono">Validar tu teléfono</label>
              <div className="input-group">
                <input type="tel" className="form-control" id="telefono" name="telefono" value={telefono} onChange={handleChange} />
                <div className="input-group-append">
                  <Link to="" className={botonesHabilitados[3] ? "btn btn-warning" : "btn btn-secondary"}>Validar</Link>
                </div>
              </div>
            </div>
            <div className="form-group">
              <label htmlFor="password">Crear contraseña</label>
              <div className="input-group">
                <input type="password" className="form-control" id="password" name="password" value={password} onChange={handleChange} />
                <div className="input-group-append">
                  <Link to="" className={botonesHabilitados[4] ? "btn btn-warning" : "btn btn-secondary"}>Crear</Link>
                </div>
              </div>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Formcuenta;
